column8:
おさるのジョージ（クラシック）ぬいぐるみＭサイズ #K6720/Curious George Classic

★サイズ：座高約20cm/全長約30cm 
★キュリアスジョージとは？：H・A・レイ、マーガレット・レイ夫妻による世界中で愛されているアメリカ生まれの絵本のシリーズ。 日本では「ひとまねこざる」の名前で1954年に出版されて以来、シリーズ化されています。
★おさるのジョージ(キュリアスジョージ)のぬいぐるみが、絵本画に近いクラシックバージョンで登場！！きいろいバッグを持った愛嬌たっぷりのヌイグルミです。大きさも全長30cmとほどよい感じ、誕生日祝い等のプレゼントとしても喜ばれます♪
